    navigate('/scan');
  };
  return (
    <div className='container'>
        <img src='/logo.png' alt='TRACKPEEK'></img>
      <h1>Trackpeek</h1>
      <p>Web Surveillance Visualizer. Enter any website URL and get a complete visual report of cookies, trackers, third-party domains, and how your data is being shared across the internet. Think of it as an x-ray for privacy.</p>
      <button onClick={handleScanClick}>Scan Me</button>
    </div>

  );
}

export default Home;
